import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss']
})
export class AppComponent {
  title = 'Qarma';

  popUpInputObject = {
    {question : 'Are you sure you want to remove the account:'},
    {name : 'pavan'},
    {submitButton : 'Remove User'},
    {conformationMessage : 'The used will be removed'},
    {conformationMessageList : 'This and this access will be removed'}

}

}
